import React from 'react';
import {Route, Switch} from 'react-router-dom';


import NewQuotes  from './pages/NewQuotes';
import AllQuotes from './pages/AllQuotes';
import DetailQuotes from './pages/DetailQuotes';



function App() {
  return (
    <React.Fragment>
      <Switch>
       <Route path="/quotes">
            <AllQuotes/>
       </Route>
       <Route path="/quotes">
            <AllQuotes/>
       </Route>
       <Route path="/quotes">
            <AllQuotes/>
       </Route>
      </Switch>
    </React.Fragment>
  );
}

export default App;
